import React from 'react';
import Footer from '../src/components/footer/Footer';
Car

const App = () => {
  return (
    <div>
        {dummyData.map((data, index) => (
        <Card
          key={index}
          username={data.username}
          date={data.date}
          text={data.text}
        />
      ))}
        <Footer/>
    </div>
  )
}

export default App;
